import React from "react";

const SideNavbar = ({ inputType, setInputType }) => {
  return (
    <div className="flex flex-col gap-4 p-2">
      <div onClick={setInputType("about")}>About</div>
      <div onClick={setInputType("education")}>Education</div>
      <div onClick={setInputType("experience")}>Experience</div>
      <div onClick={setInputType("projects")}>Projects</div>
      <div onClick={setInputType("skill")}>Skills</div>
      <div onClick={setInputType("achivement")}>Achivement</div>
    </div>
  );
};

export default SideNavbar;
